PTC Child Neglect Resulting in Death - No contest plea.   Convicted.   Sentence is withheld.   Defendant is placed on probation to DOC for two (2) years.   Conditions of probation are:
1) Comply with all assessments, treatment and counseling as recommended by DOC; 
2) AODA assessment and follow through;
3) Maintain absolute sobriety;
4) Obtain high school diploma or equivalent;
5) Full time employment or school or combination;
6) Provide DNA sample;
7) Comply with CHPS order and sign any releases necessary to ensure compliance;
8) Six (6) months Manitowoc County Jail, under the Huber Law, stayed to be imposed at agent's discretion;
9) Pay court costs and fees;
10) Pay supervision fees in an amount to be determined by DOC.  
